expressions.math:
\begin{bmatrix}
  a1 & a2  \\
  a3 & a4 \\
\end{bmatrix}
\cdot
\begin{bmatrix}
  b1 & b2 \\
  b3 & b4 \\
    \end{bmatrix}
=
\begin{bmatrix}
   (a1\cdot b1  +  a2 \cdot b3) &
   (a1 \cdot b2 +  a2 \cdot b4) \\
   (a3\cdot b1  +  a4 \cdot b3) &
   (a3 \cdot b2 +  a4 \cdot b4) \\
\end{bmatrix}

\mbox{Power}(x,\,n)=
  \begin{cases} x, & \mbox{if }n\mbox{ = 1} \\ 
                \mbox{Power}(x^2,\,n/2), & \mbox{if }n\mbox{ is even} \\
                x\times\mbox{Power}(x^2,\,(n-1)/2), & \mbox{if }n >\mbox{2 is odd}
\end{cases}

\begin{align}
0.95 & = 1-\alpha=P(-z \le Z \le z)=P \left(-1.96 \le \frac {\bar X-\mu}{\sigma/\sqrt{n}} \le 1.96 \right) \\[6pt]
& = P \left( \bar X - 1.96 \frac{\sigma}{\sqrt{n}} \le \mu \le \bar X + 1.96 \frac{\sigma}{\sqrt{n}}\right) \\[6pt]
& = P\left(\bar X - 1.96 \times 0.5 \le \mu \le \bar X + 1.96 \times 0.5\right) \\[6pt]
& = P \left( \bar X - 0.98 \le \mu \le \bar X + 0.98 \right).
\end{align}

gcd(u,  v) = 
\begin{cases}
    gcd(v, u\mbox{ mod }v), & \mbox{if }v > 0 \\
    u,                          & \mbox{if }v = 0
\end{cases}

